  false,\n\t\"url\": null,\n\t\"notes\": \"The USGS Elevation Availability service
  from The National Map (TNM) shows the best available resolution of downloadable
  elevation data, and is updated approximately every two weeks with National Elevation
  Dataset (NED) releases. NED 2- (in Alaska only), 1-, and 1/3-arc-second data are
  staged for download by 1x1 degree tiles in ArcGrid, GridFloat, or IMG formats in
  The National Map viewer, while NED 1/9 arc-second data is staged by 15x15 minute
  tiles in IMG format only. For additional information on the NED, go to http://ned.usgs.gov/.\",\n\t\"license_title\":
